CREATE TABLE locations (
  id SERIAL NOT NULL PRIMARY KEY,
  city CHARACTER VARYING(255) NOT NULL,
  country CHARACTER VARYING(255) NOT NULL,
  country_code CHARACTER VARYING(2) NOT NULL
);
ALTER TABLE locations OWNER TO tarik;


-- MAYBE ALSO BRAND/MODEL? IDK, mail is not very detailed -- 

CREATE TABLE switches (
  id SERIAL NOT NULL PRIMARY KEY,
  alias CHARACTER VARYING(255) NOT NULL,
  port_count SMALLSERIAL NOT NULL,
  location_id INTEGER NOT NULL REFERENCES locations(id)
);

ALTER TABLE switches OWNER TO tarik;

-- Just creating it columns randomly. Not a grand design or smth 

CREATE TABLE ports (
  id SERIAL NOT NULL PRIMARY KEY,
  creation_time TIMESTAMPTZ NOT NULL DEFAULT now(),
  interface_name CHARACTER VARYING(255) NOT NULL,
  port SMALLSERIAL NOT NULL,
  vlan_id INTEGER NOT NULL,
  ipv6 CHARACTER VARYING(255) NOT NULL,
  switch_id SERIAL NOT NULL REFERENCES switches(id)
);
ALTER TABLE ports OWNER TO tarik;

